import NavLinks from "./NavLinks";
import logo from "../images/logo.svg";

const Header = () => {
  return (
    <header className="header">
      <img className="logo" src={logo} alt="Niccolo' Borgato's Logo" />
      <NavLinks />
    </header>
  );
};

export default Header;
